/**
 * @param {string} s
 * @return {number}
 */
// 遍历字符串
// 保存每个字符的最长不重复字符串
// 比较保存的字符串长度


var lengthOfLongestSubstring = function (s) {
    var maxLen = 0,
        left = 0,
        i,
        r = 0;
    var map = {}
    if (s.length < 2) {
        return s.length
    }
    for (; r < s.length; r++) {
        i = map[s[r]]
        map[s[r]] = r
        if (i >= 0) {
            maxLen = Math.max(maxLen, r - left);
            left = Math.max(left, i + 1);
        }
    }
    return Math.max(maxLen, r - left);
};

